description:
Mischief is a documentary series for BBC Three. Its aim is to illuminate serious issues in new and unusual ways. It gets to the heart of contemporary domestic issues and turns them upside down and inside out. 

To be circumcised or not to be circumcised? That is the question and Mischief goes looking for the answer. Most American men are circumcised, whereas Brits prefer to keep their foreskin intact. So is it better to be circumcised or not? Is it healthier? Sexier? Or are circumcised men and their lovers missing out? 

Assistant Producer/Camera: Michael Ogden 
Producer/Director: Christopher Sykes 
Series Producer: Stuart Cabb 
